import React from 'react';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Col from 'react-bootstrap/Col';
import FormCheck from 'react-bootstrap/FormCheck'
import { NavLink } from 'react-router-dom';
import AuthContext from '../../context/auth-context';
import './CreateUserForm.css';

const CreatePatientForm = (props) => {

  // console.log({...props});
  // console.log("CreatePatientForm:  ", AuthContext.token);

return (
<div className="CreateFormContainer">
<Form onSubmit={props.onConfirm}>
<Form.Row>
  <Form.Group as={Col} controlId="formGridName">
  {
    // <Form.Label>name</Form.Label>
    <Form.Control type="text" placeholder="Enter name"/>
  }
  </Form.Group>

  <Form.Group as={Col} controlId="formGridAddress">
  {
    // <Form.Label>Address</Form.Label>
    <Form.Control type="text" placeholder="Address"/>
  }
  </Form.Group>
</Form.Row>

<Form.Group controlId="formGridDob">
  {
  // <Form.Label>D.O.B</Form.Label>
  <Form.Control type="date" placeholder="D.O.B" />
}
</Form.Group>

<Form.Group controlId="formGridContactEmail">
  {
  // <Form.Label>Email</Form.Label>
  <Form.Control type="email" placeholder="Email" />
}
</Form.Group>

<Form.Group controlId="formGridContactPhone">
  {
  // <Form.Label>Phone</Form.Label>
  <Form.Control type="number" placeholder="Phone" />
}
</Form.Group>

<Form.Group controlId="formGridRegistrationDate">
  {
  // <Form.Label>RegistrationDate</Form.Label>
  <Form.Control type="date" placeholder="RegistrationDate" />
}
</Form.Group>

<Form.Group controlId="formGridReferringDoctorName">
  {
  // <Form.Label>ReferringDoctorName</Form.Label>
  <Form.Control type="text" placeholder="ReferringDoctorName" />
}
</Form.Group>

<Form.Group controlId="formGridReferringDoctorEmail">
  {
  // <Form.Label>ReferringDoctorEmail</Form.Label>
  <Form.Control type="email" placeholder="ReferringDoctorEmail" />
}
</Form.Group>

<Form.Group controlId="formGridReferringDoctorPhone">
  {
  // <Form.Label>ReferringDoctorPhone</Form.Label>
  <Form.Control type="number" placeholder="ReferringDoctorPhone" />
}
</Form.Group>

<Form.Group controlId="formGridOccupationRole">
  {
  // <Form.Label>OccupationRole</Form.Label>
  <Form.Control type="text" placeholder="OccupationRole" />
}
</Form.Group>

<Form.Group controlId="formGridOccupationEmployer">
  {
  // <Form.Label>OccupationEmployer</Form.Label>
  <Form.Control type="text" placeholder="OccupationEmployer" />
}
</Form.Group>

<Form.Group controlId="formGridOccupationEmployerContactPhone">
  {
  // <Form.Label>OccupationEmployerContactPhone</Form.Label>
  <Form.Control type="number" placeholder="OccupationEmployerContactPhone" />
}
</Form.Group>

<Form.Group controlId="formGridOccupationEmployerContactEmail">
  {
  // <Form.Label>OccupationEmployerContactEmail</Form.Label>
  <Form.Control type="email" placeholder="OccupationEmployerContactEmail" />
}
</Form.Group>

<Form.Group controlId="formGridnextOfKinName">
  {
  // <Form.Label>nextOfKinName</Form.Label>
  <Form.Control type="text" placeholder="nextOfKinName" />
}
</Form.Group>

<Form.Group controlId="formGridNextOfKinEmail">
  {
  // <Form.Label>NextOfKinEmail</Form.Label>
  <Form.Control type="email" placeholder="NextOfKinEmail" />
}
</Form.Group>

<Form.Group controlId="formGridNextOfKinPhone">
  {
  // <Form.Label>NextOfKinPhone</Form.Label>
  <Form.Control type="number" placeholder="NextOfKinPhone" />
}
</Form.Group>

<Form.Group controlId="formGridInsuranceCompany">
  {
  // <Form.Label>InsuranceCompany</Form.Label>
  <Form.Control type="text" placeholder="InsuranceCompany" />
}
</Form.Group>

<Form.Group controlId="formGridInsuranceNumber">
  {
  // <Form.Label>InsuranceNumber</Form.Label>
  <Form.Control type="number" placeholder="InsuranceNumber" />
}
</Form.Group>

<Form.Group controlId="formGridInsuranceDescription">
  {
  // <Form.Label>InsuranceDescription</Form.Label>
  <Form.Control type="text" placeholder="InsuranceDescription" />
}
</Form.Group>

<Form.Group controlId="formGridInsuranceExpiry">
  {
  // <Form.Label>InsuranceExpiry</Form.Label>
  <Form.Control type="date" placeholder="InsuranceExpiry" />
}
</Form.Group>

<Form.Group controlId="formGridInsuranceSubscriberCompany">
  {
  // <Form.Label>InsuranceSubscriberCompany</Form.Label>
  <Form.Control type="text" placeholder="InsuranceSubscriberCompany" />
}
</Form.Group>

<Form.Group controlId="formGridInsuranceSubscriberDescription">
  {
  // <Form.Label>InsuranceSubscriberDescription</Form.Label>
  <Form.Control type="text" placeholder="InsuranceSubscriberDescription" />
}
</Form.Group>

<Form.Group controlId="formGridComplaintDate">
  {
  // <Form.Label>ComplaintDate</Form.Label>
  <Form.Control type="date" placeholder="ComplaintDate" />
}
</Form.Group>


{props.canCancel && (
  <Button variant="primary" onClick={props.onCancel}>
  Cancel
  </Button>
)}

{props.canConfirm && (
  <Button variant="secondary" type="submit" >
  Submit
  </Button>
)}

</Form>
{
  // <AuthContext.Consumer>
// </AuthContext.Consumer>
}
</div>

)};

export default CreatePatientForm;
